import Element from './Element'
import Type from '../enums/Type'

class Canvas extends Element {
    constructor() {
        super('canvas')
        this._context = this.getContext2D()
    }
    getContext() {
        return this._context
    }
    setContext(ctx) {
        return this._context = this.getContext(ctx)
    }
    getContext2D() {
        return this.getElement().getContext('2d')
    }
    getContext3D() {
        return this.getElement().getContext('3d')
    }
    drawLine(beginX, beginY, endX, endY) {
        this.moveTo(beginX, beginY)
        this.lineTo(endX, endY)
        this.stroke()
    }
    drawSquare(x, y, width, height, type) {
        switch (type) {
            case 'stroke':
                this.strokeRect(x, y, width, height, type)
                break
            case 'clear':
                this.clearRect(x, y, width, height, type)
                break
            default:
                this.fillRect(x, y, width, height, type)
        }
    }
    drawTriangle(x, y, x1, y1, x2, y2, type) {
        this.beginPath()
        this.moveTo(x, y)
        this.lineTo(x1, y1)
        this.lineTo(x2, y2)

        switch (type) {
            case Type.STROKE:
                this.stroke()
                break
            case Type.CLEAR:
                this.clear()
                break
            default:
                this.fill()
        }
    }
    drawTriangleByDimension(x, y, dimension, type) {
        this.beginPath()
        this.moveTo(x, y)
        this.lineTo(x - dimension, y + dimension)
        this.lineTo(x + dimension, y + dimension)

        switch (type) {
            case Type.STROKE:
                this.stroke()
                break
            case Type.CLEAR:
                this.clear()
                break
            default:
                this.fill()
        }
    }
    fillRect(x, y, width, height, type) {
        this.getContext().fillRect(x, y, width, height, type)
    }
    lineTo(x, y) {
        this.getContext().lineTo(x, y)
    }
    moveTo(x, y) {
        this.getContext().moveTo(x, y)
    }
    beginPath() {
        return this.getContext().beginPath()
    }
    closePath() {
        return this.getContext().closePath()
    }
    stroke() {
        return this.getContext().stroke()
    }
    fill() {
        return this.getContext().fill()
    }
    clear() {
        return this.getContext().clear()
    }

}

export default Canvas

class Element {

    constructor(element, width, height, border) {
        this.setElement(element)
        this.setWidth(width)
        this.setHeight(height)
        this.setBorder(border)
        console.log(this.getClassName().concat(' Created!'))
    }

    createElement(element) {
        return document.createElement(element)
    }
    getElement() {
        return this._element
    }
    setElement(element) {
        this._element = this.createElement(element)
    }
    getAttributes() {
        return this.getElement().attributes
    }
    setAttribute(attr, value) {
        this.getElement().setAttribute(attr, value)
    }
    setStyle(attr, value) {
        this.setAttibute('style', attr + ': ' + value)
    }
    setSize(width, height) {
        this.setWidth(width)
        this.setHeight(height)
    }
    setWidth(width = 200) {
        this.getElement().setAttribute('style', 'width: '.concat(width))
        return this.getElement()
    }
    setHeight(height = 200) {
        this.getElement().setAttribute('style', 'height: '.concat(height))
        return this.getElement()
    }
    setBorder(border = '1px solid black') {
        this.getElement().setAttribute('style', 'border: '.concat(border))
        return this.getElement()
    }
    addChild(child) {
        this.getElement().appendChild(child)
        return this.getElement()
    }
    addToBody() {
        document.body.appendChild(this.getElement())
        return this.getElement()
    }
    addToElementById(id) {
        document.getElementById(id).appendChild(this.getElement())
        return this.getElement()
    }
    addToElementByClassName(className) {
        document.getElementsByClassName(className).appendChild(this.getElement())
        return this.getElement()
    }
    getClassName() {
        return this.constructor.name
    }
}

export default Element

import Element from '../elements/Element.js'

class Image extends Element{
    constructor(src) {
        super('img')
        this.setSrc(src)
    }
    getImage() {
        return this._image
    }
    setSrc(src) {
        this._src = super.setAttribute('src', src)
    }
    getSrc(src) {
        return this._src
    }
}

export default Image

